import time


def check_string(n):
    flag = True
    counts_of_dot = 0
    counts_of_minuses = 0
    for i in n:
        if i not in "1234567890.-":
            flag = False
        elif i in "-" and i != n[0]:
            flag = False
        elif i in "-":
            counts_of_minuses += 1
        elif i in ".":
            counts_of_dot += 1
    if counts_of_dot > 1 or counts_of_minuses > 1:
        flag = False
    if flag == False:
        print(" Вы ввели не коректное число:")
    else:
        if n.isdigit():
            print("Вы ввели положительное целое число:")
        else:
            if float(n) % 1 != 0:
                if float(n) < 0:
                    print("Вы ввели отрицательное дробное число:")
                else:
                    print("Вы ввели положительное дробное число:")
            else:
                print("Вы ввели отрицательное целое число:")


def _already_has_dot(ch, is_float):
    return ch == '.' and is_float


def own_is_digit(data):
    numbers_list = '0123456789.'
    is_negative, is_float = '-' == data[0], False

    for ch in data[1:] if is_negative else data:
        if _already_has_dot(ch, is_float) or ch not in numbers_list:
            return 'This is wrong number'

        is_float = ch == '.' or is_float

    print(f'This is {"negative" if is_negative else "positive"} {"fractional number" if is_float else "integer"}')


# assert own_is_digit('3.') == 'This is positive fractional number'

start_time = time.monotonic()

own_is_digit('-')
print(f'Прошло {time.monotonic() - start_time}')
